import styled from "styled-components";
import TagCloud from '../TagCloud';

const Container = styled.div`
    width: 20rem;
`;

function TagCloudList() {
    return (<Container>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
        <TagCloud url="#">111</TagCloud>
    </Container>)
}

export default TagCloudList;
